def dfs(x, y, cnt):
    print(cnt)
    if cnt > 100:
        return False
    if data[x][y] == 2:
        return True
    else:
        dfs(x+1, y, cnt+1)

    return False



# dfs() 내부에서 현재 항목의 왼쪽 오른쪽 사다리가 있는지 확인
def left_right(x,y):
    if x-1 < 0 and x+1 > 100:
        if data[x-1][y] == 1:
            print('left')   # 왼쪽있으면 0 리턴
            return 0
        if data[x+1][y]:
            print('right') # 오른쪽 있으면 1 리턴
            return 1

data = []
for i in range(100):
    data.append(list(map(int, input().split()) ))

for j in range(100):
    if data[1][j] == 1:
        print(j, end = ' ')

        dfs(1,j, 1)


